import React from 'react';
import { Link } from 'react-router-dom';

const EventsPage = () => {
  const EVENTES=[
    {id: 'e1', title: 'event-1'},
    {id: 'e2', title: 'event-2'},
    {id: 'e3', title: 'event-3'},
    {id: 'e4', title: 'event-4'},
  ]
  return (
    <>
    <h1>The Event Page</h1>
    <ul>
      {EVENTES.map((event)=>(
        <li key={event.id}><Link to={event.id}>{event.title}</Link></li>
      ))}
    </ul>
    </>
  )
}

export default EventsPage
